import { Link } from "react-router-dom";
import "../style/Ecommerce_style.css";

const Slider_Ecommerce = () => {
  return (
    <>

      <div class="card">
        <div class="card-body">
          <ul>
            <li className="">
              <Link to="https://sotooracademy.com/sotoor-ecommerce">
                <img
                  src="https://sotooracademy.com/public/sotoor_ecommerce_assets/images/main-logo.png"
                  width="30px"
                />{" "}
                متجر سطور للقدرات{" "}
              </Link>
            </li>
            <li className="icon_style">
              <Link to="https://sotooracademy.com/cart">
                <i className="fa fa-shopping-bag"></i>
                <span>0 </span>
              </Link>
            </li>
            <li >
              <Link to="https://sotooracademy.com/login">
                <i className="fa fa-user-circle"></i>{" "}
              </Link>
            </li>
          </ul>
        </div>
      </div>

      <img src="https://sotooracademy.com/public/sotoor_ecommerce_assets/images/head_banner.jpg" className="img_style"></img>
    </>
  );
};

export default Slider_Ecommerce;
